import React from 'react';
import { createDrawerNavigator } from '@react-navigation/drawer';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { NavigationContainer } from '@react-navigation/native';

// Importar tus pantallas
import Home from './src/screens/Home';
import Menu from './src/screens/Menu';
import NearbyStores from './src/screens/NearbyStores'; 
import Order from './src/screens/Order'; 
import Settings from "./src/screens/Settings";
import AboutUs from "./src/screens/AcercaDe";

const Drawer = createDrawerNavigator();
const Tab = createBottomTabNavigator();

// Funci√≥n para renderizar el Tab Navigator
function TabNavigator() {
  return (
    <Tab.Navigator>
      <Tab.Screen name="Home" component={Home} />
      <Tab.Screen name="Menu" component={Menu} />
      <Tab.Screen name="NearbyStores" component={NearbyStores} />
    </Tab.Navigator>
  );
}

export default function App() {
  return (
    <NavigationContainer>
      <Drawer.Navigator initialRouteName="Tabs">
        <Drawer.Screen name="Tabs" component={TabNavigator} />
        <Drawer.Screen name="Order" component={Order} /> 
        <Drawer.Screen name="Settings" component={Settings} /> 
        <Drawer.Screen name="AboutUs" component={AboutUs} /> 
      </Drawer.Navigator>
    </NavigationContainer>
  );
}
